Doing baby hawk stuff in the yard. The more the bird gets to explore and experience now, the better. You can see I offer my hand and observe the bird’s behavior to determine if he wants touch interaction or not. Which in this case he does! He is now napping under my chair.

@raptoraddicts’ northern goshawk, 34 days old. 

#northerngoshawk

After her surgery, @raptoraddicts modified Platinum’s hood with a guard to ensure she won’t pick at the wound. She does get supervised time without the guard on as well, but it’s a great way to ensure her wing heals correctly when we can’t watch her. 

My friends are full of jokes about her new look…

